function Movie({ title_long, medium_cover_image, genres, summary }) {
  return (
    <div>
      <h2>{title_long}</h2>
      <img alt={title_long} src={medium_cover_image}></img>
      <ul>
        {genres.map((g) => (
          <li key={g}>{g}</li>
        ))}
      </ul>
      <p>{summary}</p>
    </div>
  );
}
export default Movie;
